/*
    本文件为所有组件的外壳组件
*/
import React, { Component } from 'react'
import Count from './containers/Count'
import store from './redux/store'


export default class App extends Component {
    render() {
        return (
            <div>
                {/* 给容器组件传递store */}
                <Count store={store} />
            </div>
        )
    }
}
